import React, { useState, useEffect } from "react";
import axios from "axios";
import Dragons from "./Dragons";
import DragonInfo from "./DragonInfo";
import { Link } from "react-router-dom";
const Dragon = () => {
  //api calling
  const [data, setData] = useState([]);
  useEffect(() => {
    axios.get("https://api.spacexdata.com/v3/dragons").then((response) => {
      console.log(response.data);
      setData(response.data);
    });
  }, []);

  return (
    <div className="container">
      <div className="row">
        {data.map((data) => {
          return (
            <div className="col-sm-8" key={data.name}>
              <Dragons
                name={data.name}
                type={data.type}
                active={data.active}
                crew_capacity={data.crew_capacity}
                mass={data.dry_mass_kg}
                first_flight={data.first_flight}
                wikipedia={data.wikipedia}
                description={data.description}
                size={data.size_meters}
                img={data.flickr_images}
                dev_partner={data.heat_shield.dev_partner}
                material={data.heat_shield.material}
              />
              {/* <div className="row"> */}
                <div className="col-sm-4">
                  <img
                    src={data.flickr_images}
                    className="card-img-top img-fluid"
                    alt="..."
                    style={{ height: "400px" }}
                  />
                </div>
              </div>
            // </div>
          );
        })}
      </div>
    </div>
  );
};

export default Dragon;
